import * as React from 'react'
import { IconButton, Typography, Box, Menu, MenuItem, Avatar, Chip } from '@mui/material'
import { CustomizedAvatarButton, CustomizedIconButton, CustomizedIconButtonOpen } from '../ux-components/Button-SX'

import theme from '../../theme'
const { palette } = theme
import { LibraryAdd } from '@mui/icons-material'
import CustomTooltip from '../ux-components/Tooltip'

const CustomizedMenu = {
  '& .MuiPaper-root': {
    background: 'white',
    color: palette.text.primary,
    boxShadow: 5,
    p: 0.5,
    width: 250,
    '& .MuiMenuItem-root': {
      background: 'transparent',
      pb: 1,
    },
  },
}

const CustomizedChip = {
  fontSize: '0.9rem',
  mb: 0.2,
  border: 1,
  borderColor: palette.secondary.light,
  letterSpacing: '0.05px',
  '&:hover': {
    borderColor: palette.primary.main,
    bgcolor: palette.primary.main,
    transition: 'none',
    color: palette.text.primary,
    fontWeight: 500,
    letterSpacing: '0px',
  },
  '&:active': {
    boxShadow: 0,
  },
  '&.MuiChip-filled': {
    color: 'white',
    letterSpacing: '0.05px',
    '&:hover': {
      letterSpacing: '0px',
    },
  },
  '& .MuiChip-label': {
    px: 1,
  },
}

const referenceColors = ['#4285F4', '#0F9D58', '#F4B400', '#DB4437']

const references = [
  {
    id: 1,
    name: 'Cat',
    iconImage:
      'data:image/png;base64,',
    referenceColor: '#4285F4',
  },
  {
    id: 2,
    name: 'Dog',
    iconImage:
      'data:image/png;base64,',
    referenceColor: '#0F9D58',
  },
]

export default function ReferencePicker({}) {
  const [anchorEl, setAnchorEl] = React.useState<HTMLButtonElement | null>(null)

  const handleClick = (event: React.MouseEvent<HTMLButtonElement>) => {
    setAnchorEl(event.currentTarget)
  }

  const open = Boolean(anchorEl)

  const handleClose = () => {
    setAnchorEl(null)
  }

  return (
    <>
      <CustomTooltip title="Add references" size="small">
        <IconButton onClick={handleClick} disableRipple sx={{ px: 0.5 }}>
          <Avatar sx={{ ...CustomizedAvatarButton, ...(open === true && CustomizedIconButtonOpen) }}>
            <LibraryAdd
              sx={{
                ...CustomizedIconButton,
                ...(open === true && CustomizedIconButtonOpen),
              }}
            />
          </Avatar>
        </IconButton>
      </CustomTooltip>
      <Menu
        anchorEl={anchorEl}
        anchorOrigin={{
          vertical: 'bottom',
          horizontal: 'center',
        }}
        transformOrigin={{
          vertical: 'top',
          horizontal: 'center',
        }}
        open={open}
        onClose={handleClose}
        sx={CustomizedMenu}
      >
        {references.map((reference) => (
          <Chip
            avatar={<Avatar alt="Natacha" src={reference.iconImage} />}
            label={reference.name}
            key={reference.name}
            variant="outlined"
            sx={{ ...CustomizedChip, ...{ cursor: 'pointer' } }}
          />
        ))}
      </Menu>
    </>
  )
}
